// Styled components for styling
const AnimatedPanel = styled(Panel)`
  margin: 20px;
  opacity: 0;
  animation: ${fadeIn} 1s forwards;
  display: flex;
  justify-content: space-between;
  align-items: center;
  display: flex;
  position: relative;
`;

